dir_csm_currweek=`ls -td $dir_csm_curryear/* | head -n 1`
dir_cur_replicat="$dir_csm_currweek/mytrybits";

### ********************
### begin_ init functions
### seealso href="smartpath://mytrybits/b/trybash/shell/tryfunction.sh"
function win_go {
  ## echo $1;
  ## echo $dir_cur_replicat;
  out_mung_name=`echo $1 | perl -ne '@F = split("/", $_); print "$F[-3]-$F[-2]-$F[-1]";'`
  (mkdir -p $dir_cur_replicat);
  (cd $dir_cur_replicat && (mkshortcut --name=$out_mung_name $1));
  (cd $1 && "/cygdrive/c/windows/system32/explorer.exe" .);
}      
